  return (
    <React.Fragment>
      <main>
        <div className="input-container"></div>
      </main>

      <style jsx>{`
        main {
          width: 100%;
          height: 80vh;
          position: relative;
        }

        .input-container {
          position: absolute;
          top: 0;
          left: 0;
          transform: translate(50%, 50%);
          width: 50%;
          height: 70%;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default ResetPasswordPage;
